	section_three_body_text: 'A Kézdivásárhelyi Családos Keresztény Fesztivállal egy nyári pihenési és töltekezési lehetőséget szeretnénk biztosítani a családoknak. Mivel a családok nyaranta rengeteg kikapcsolódási lehetőség közül válogathatnak, ezért a mi fesztiválunk programja és légköre kimondottan keresztény lesz. Kirándulási, kikapcsolódási, töltekezési és sportolási lehetőségek mellett a házasságot érintő gondolatébresztőkön, előadásokon, életút beszélgetéseken vehetnek részt a fesztiválra látogatók. Természetesen a fesztiválok elvárásainak eleget téve koncertekre is sor kerül, de dicsőítésre, példaértékű családokkal fórumbeszélgetésekre, élményszínházra és egyéb alternatív programokra is sor kerül a rendezvényen. Mivel a család egészének kínálunk programot, ezért a gyerekek, ifjak részére külön programot is szervezünk, ahol ki-ki a korosztályának megfelelő tevékenységekbe kapcsolódhat be.',
